import React, {Component} from 'react';


  
class ToDo extends Component {
    
    state={ };

    render() {
        return (
           <div className="row">
               <div className="col">
                   <div className="card m-5">
                        <div className="card-body">
                                Basic-body
                        </div>
                   </div>
               </div>
           </div>
        );
    }
}

export default ToDo;
